import React, { Component } from "react";
import { Button } from 'reactstrap';


class PersonList extends Component {
  render() {
    return (
      <div>
        <button class="btn btn-outline-secondary" onClick={this.props.onAddPerson}>Add Person</button>
        <button class="btn btn-outline-secondary" onClick={this.props.onDeletePerson}>Delete Person</button>

        {this.props.people}
      </div>
    );
  }
}

export default PersonList;
